import ExpenseItem from "./ExpenseItem";

import "./Expenses.css";

function Expenses(props) {
  console.log(props);

  return (
    <div className="expenses">
      <ExpenseItem
        title={props.datatitle}
        amount={props[0].amount}
        date={props[0].date}
      ></ExpenseItem>
      <ExpenseItem
        title={props[1].title}
        amount={props[1].amount}
        date={props[1].date}
      ></ExpenseItem>
      <ExpenseItem
        title={props[2].title}
        amount={props[2].amount}
        date={props[2].date}
      ></ExpenseItem>
    </div>
  );
}

export default Expenses;
